import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
    root: {
        // maxWidth: 345, original width style
        maxWidth: '100%',
        display: 'flex',
        flexDirection: 'row',
      },

      

      media: {
        height: 0,
        paddingTop: '0%', // 16:9
        display: 'inline',
      },
      
      // cardActions: {
